import React from 'react';
import Header from '../header/Header';
import './style.scss';

function App() {
  return (
    <div className="app">
      <Header />
      <div className="main">
        <div className="sidebar">
          <div className="sidebar__title">Explore</div>
          <ul className="sidebar__list">
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> New In
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Clothing
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Shoes
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Accessories
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Activewear
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Giftsw and Living
            </li>
            <li className="sidebar__item">
              {' '}
              <img src="" alt="" /> Inspiration
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default App;
